/*/js/framework/keis.ajax.js*/			keis.ajax = function (url, type, dataType, token, header) {this.url = url;this.type = type;this.dataType = dataType;this.param = "";this.token = token;this.header = header;};keis.ajax.prototype.addParam = function (name, value) {if(this.param.length == 0){this.param += name + "=" + encodeURIComponent(value);} else {this.param += "&" + name + "=" + encodeURIComponent(value);}};keis.ajax.prototype.send = function (callBack){var oThis	= this;$.ajax({type: this.type,url: this.url, data: this.param,dataType: this.dataType,beforeSend: function(request){var token = $("meta[name='_csrf']").attr("content");var header = $("meta[name='_csrf_header']").attr("content");if(token != null && token != 'undefinded'){request.setRequestHeader(header, token);}else if(oThis.header != null && oThis.token != null ){request.setRequestHeader(oThis.header, oThis.token);}},success: function(msg) {if(msg==null) return;try {return typeof callBack == 'function' ? callBack(msg, oThis) : eval(callBack+'(msg)');} catch (err) {}},error: function(msg){console.log('keis.ajax.prototype.send : ' + msg);}});};

var doubleSubmitFlag = false;
function doubleSubmitCheck(){
	//웹필터가 걸린곳은 doubleSubmitCheck 를 2번 check 하기 때문에 check 하지 않음.
//	console.log('webfilterTargetFrame==>' + $('#webfilterTargetFrame').attr('name'));	
	if('webfilterTargetFrame'==$('#webfilterTargetFrame').attr('name') ) {
//		console.log('doubleSubmitCheck : ' + doubleSubmitFlag);		
		return false;
	} else {
		if(doubleSubmitFlag){
			alert("처리중입니다. 잠시만 기다려 주세요.");
			return doubleSubmitFlag;
		}else{
			doubleSubmitFlag = true;
			return false;
		}
	}
}
